import React from 'react';
import {
    View,
    Text,
    SafeAreaView,
    TouchableOpacity
} from 'react-native';

import { Ionicons } from '@expo/vector-icons';
import { MaterialIcons } from '@expo/vector-icons';

const CourseHome = () => {
    function renderHeader(){
        return(
            <View>
                <View>
                    <Ionicons name="arrow-back" size={24} color="black" />
                    <MaterialIcons name="message" size={24} color="black" />
                </View>
                <View>
                    <Text>GHS Atiela</Text>
                    <Text>Biology Fundamentals</Text>
                    <Text>120 learners</Text>
                </View>
                <View>
                    <TouchableOpacity>
                        <Text>lessons</Text>
                    </TouchableOpacity>
                    <TouchableOpacity>
                        <Text>quizzes</Text>
                    </TouchableOpacity>
                    <TouchableOpacity>
                        <Text>references</Text>
                    </TouchableOpacity>
                </View>
            </View>
        )
    }
    return(
        <SafeAreaView>
            {renderHeader()}
        </SafeAreaView>
    )
}

export default CourseHome;
